import React, { useState, useEffect } from 'react';
import Calendar from 'react-calendar';
import axios from 'axios';

import './IPOCalendar.css';


const IPOCalendar = () => {
  const [ipoData, setIPOData] = useState([]);

  useEffect(() => {
    // Fetch IPO data here
    // Example: Fetch data from an API using Axios
    // Replace 'YOUR_API_ENDPOINT' with your actual API endpoint

    const fetchIPOData = async () => {
      try {
        const response = await axios.get('https://api.iex.cloud/v1/data/CORE/UPCOMING_IPOS/market?token=pk_3a32cbeded39453aa11bc7fac06f97db/ipo');
        setIPOData(response.data);
      } catch (error) {
        console.error('Error fetching IPO data:', error);
      }
    };

    fetchIPOData();
  }, []);

  return (
    <div>
      <h2>Upcoming IPOs</h2>
      <Calendar />
      {/* Render IPO data */}
      <ul>
        {ipoData.map((ipo) => (
          <li key={ipo.id}>{ipo.name}</li>
        ))}
      </ul>
    </div>
  );
};

export default IPOCalendar;
